    ("Pacientul în vârstă de 65 de ani, cunoscut cu insuficiență cardiacă congestivă, a fost supus unei ecocardiografii. Fracția de ejecție stangă a fost de 46%, indicând o disfuncție sistolică moderată. În ceea ce privește ventriculul drept, fracția de ejecție a ventriculul drept este de 44%, ușor scăzută, ceea ce ar putea fi o consecință a insuficienței cardiace globale. Volumul atrial stâng este semnificativ mărit, la 78 ml, indicând o dilatare atrială avansată. Volumul atrial drept este de 72 ml, sugerând o presiune ridicată la nivelul ventriculului drept. Septul interventricular prezintă o grosime de 13 mm, iar peretele ventricular stâng are o grosime de 12 mm, ceea ce indică o hipertrofie concentrată, posibil secundară presiunii sistemice crescute. Debit cardiac a fost de 4.9 l/min, ușor redus față de normal, iar presiunea arterelor pulmonare a fost măsurată la 32 mmHg, confirmând hipertensiunea pulmonară moderată.Fracția de ejecție stângă de 38% semnalează o disfuncție sistolică severă, indicând un risc crescut de insuficiență cardiacă avansată și necesitând intervenție terapeutică agresivă.", {"entities": [(928, 953, "FEG_STANGA"), (957, 959, "VALUE_FEG_STANGA"), (928, 953, "FEG_STANGA"), (957, 959, "VALUE_FEG_STANGA"), (237, 275, "FEG_DREAPTA"), (284, 286, "VALUE_FEG_DREAPTA"), (540, 559, "FEG_DREAPTA"), (607, 612, "VALUE_FEG_DREAPTA"), (370, 390, "VOLUM_ATRIAL_STANG"), (419, 424, "VALUE_VOLUM_ATRIAL_STANG"), (378, 390, "VOLUM_ATRIAL_STANG"), (419, 424, "VALUE_VOLUM_ATRIAL_STANG"), (464, 484, "VOLUM_ATRIAL_DREPT"), (493, 498, "VALUE_VOLUM_ATRIAL_DREPT"), (561, 584, "DIAMETRU_SEPTAL"), (607, 612, "VALUE_DIAMETRU_SEPTAL"), (561, 603, "GROSIME_PERETE"), (607, 612, "VALUE_GROSIME_PERETE"), (618, 658, "GROSIME_PERETE"), (662, 667, "VALUE_GROSIME_PERETE"), (759, 772, "DEBIT_CARDIAC"), (783, 792, "VALUE_DEBIT_CARDIAC"), (825, 854, "PRESIUNE_ARTERELOR"), (874, 881, "VALUE_PRESIUNE_ARTERELOR")]}),
